import React, { useState, useEffect } from 'react';
import './FoodChainSimulator.css';

const FoodChainSimulator = () => {
  const [restaurants, setRestaurants] = useState(100);
  const [contaminated, setContaminated] = useState(0);
  const [customersAffected, setCustomersAffected] = useState(0);
  const [reputation, setReputation] = useState(100);
  const [time, setTime] = useState(60 * 60); // 60 minutos

  const scenarios = [
    {
      id: 1,
      title: "üçî CONTAMINACI√ìN DIGITAL EN MEN√ö",
      description: "Hackers alteran sistema de pedidos - a√±aden al√©rgenos a comidas 'libres de...'",
      decisions: [
        { text: "üîí CERRAR TODOS LOS LOCALES", impact: { reputation: -30, customers: -1000 } },
        { text: "üîÑ ACTUALIZAR SISTEMA EN L√çNEA", impact: { reputation: -10, restaurants: -20 } },
        { text: "üì¢ ALERTA P√öBLICA INMEDIATA", impact: { reputation: -20, customers: -5000 } }
      ]
    },
    {
      id: 2, 
      title: "üí∞ FRAUDE MASIVO EN PAGOS",
      description: "Sistema de pago comprometido - datos de tarjetas robados",
      decisions: [
        { text: "üí≥ CONGELAR TODOS LOS PAGOS", impact: { reputation: -40, restaurants: -50 } },
        { text: "üîê MIGRAR A SISTEMA NUEVO", impact: { reputation: -15, time: -30 } },
        { text: "üè¶ NOTIFICAR BANCOS", impact: { reputation: -25, customers: -10000 } }
      ]
    }
  ];

  return (
    <div style={{
      background: 'linear-gradient(135deg, #0f0f23 0%, #1a1a2e 100%)',
      minHeight: '100vh',
      color: 'white',
      padding: '20px'
    }}>
      <h1 style={{ color: '#ff9900' }}>üçî SIMULADOR CADENA DE COMIDA R√ÅPIDA</h1>

      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(4, 1fr)',
        gap: '20px',
        margin: '30px 0',
        background: 'rgba(255, 153, 0, 0.1)',
        padding: '20px',
        borderRadius: '15px',
        border: '2px solid #ff9900'
      }}>
        <div>
          <h3>üè™ LOCALES</h3>
          <p style={{ fontSize: '2rem' }}>{restaurants}/100</p>
        </div>
        <div>
          <h3>‚ö†Ô∏è CONTAMINADOS</h3>
          <p style={{ fontSize: '2rem', color: '#ff2e63' }}>{contaminated}</p>
        </div>
        <div>
          <h3>üë• AFECTADOS</h3>
          <p style={{ fontSize: '2rem' }}>{customersAffected.toLocaleString()}</p>
        </div>
        <div>
          <h3>‚≠ê REPUTACI√ìN</h3>
          <p style={{ fontSize: '2rem', color: reputation > 50 ? '#00ff9d' : '#ff2e63' }}>
            {reputation}%
          </p>
        </div>
      </div>

      <div style={{
        background: 'rgba(255, 255, 255, 0.05)',
        padding: '30px',
        borderRadius: '15px',
        marginBottom: '30px'
      }}>
        <h2 style={{ color: '#ff9900' }}>üö® ESCENARIO ACTUAL</h2>
        <h3>{scenarios[0].title}</h3>
        <p>{scenarios[0].description}</p>

        <div style={{ marginTop: '30px' }}>
          <h3>ü§î ¬øQU√â DECIDES?</h3>
          {scenarios[0].decisions.map((decision, idx) => (
            <button
              key={idx}
              style={{
                background: idx === 0 ? '#ff2e63' : idx === 1 ? '#ff9900' : '#9d4edd',
                color: 'white',
                border: 'none',
                padding: '15px',
                width: '100%',
                marginBottom: '10px',
                borderRadius: '8px',
                fontSize: '1rem',
                cursor: 'pointer',
                fontFamily: 'monospace'
              }}
              onClick={() => alert(`Decisi√≥n: ${decision.text}`)}
            >
              {decision.text}
            </button>
          ))}
        </div>
      </div>

      <button
        onClick={() => window.location.href = '/'}
        style={{
          background: '#9d4edd',
          color: 'white',
          border: 'none',
          padding: '12px 24px',
          borderRadius: '8px',
          cursor: 'pointer',
          fontSize: '1rem',
          fontWeight: 'bold'
        }}
      >
        ‚Üê VOLVER AL DASHBOARD
      </button>
    </div>
  );
};

export default FoodChainSimulator;
